import numpy as np
import pandas as pd
from sklearn.model_selection import train_test_split,KFold
from sklearn.preprocessing import StandardScaler,MinMaxScaler
from sklearn.decomposition import PCA
from collections import Counter
import matplotlib.pyplot as plt
import seaborn as sns

'''
    part1
        load sonar dataset
'''

def plot_sonar(data,feature1,feature2):
    '''
        Use seaborn to show the dataset
    '''
    sns.lmplot(x=feature1,y=feature2,data=data,hue='class',fit_reg=False)
    plt.xlabel(feature1)
    plt.ylabel(feature2)
    plt.title(f"sonar_data plot with : {feature1} and {feature2}")
    plt.show()

def load_dataset():
    '''
        Load Iris datasets
    '''
    sonar = pd.read_csv('../dataset/sonar.all-data.csv')
    x = sonar.iloc[:,:-1].values
    y = sonar.iloc[:,-1].values
    print(f"the count of all data classes: {Counter(y)}")

    ''' for analyse the most distinguishable feature '''
    # feature_name  = []
    # for i in range(60):
    #     feature_name.append(str(i))
    # feature_name.append("class")
    # sonar.columns = feature_name
    # for i in range(60):
    #     plot_sonar(sonar,str(i),str(i))
    # print(sonar)
    return train_test_split(x,y,random_state=22,train_size=0.7)

x_train,x_test,y_train,y_test = load_dataset()

print(f"the count of train data classes: {Counter(y_train)}")
print(f"the count of test data classes: {Counter(y_test)}")


'''
    part2:
        data processing
'''

def data_processing_standard():
    global x_train,x_test
    transfer = StandardScaler()
    x_train = transfer.fit_transform(x_train)
    x_test = transfer.transform(x_test)

def data_processing_minmax():
    global x_train,x_test
    transfer = MinMaxScaler()
    x_train = transfer.fit_transform(x_train)
    x_test = transfer.transform(x_test)

x_train_pca = None
x_test_pca = None

def pca_down_dimension(n_components):
    global x_train,x_test,x_train_pca,x_test_pca
    pca = PCA(n_components=n_components)
    x_train_pca = pca.fit_transform(x_train)
    x_test_pca  = pca.transform(x_test)
    # print(pca.explained_variance_ratio_)
    # print(np.sum(pca.explained_variance_ratio_))
    # print(x_train_pca.shape)
    return np.sum(pca.explained_variance_ratio_)

# 先进行标准化后在进行PCA
data_processing_standard()
# data_processing_minmax()
pca_down_dimension(41)

'''
    part3:
        build model
'''

class Knn:
    def __init__(self,neighbour):
        self.neighbour = neighbour
    def train(self,X_train,y_train):
        self.X = X_train
        self.y = y_train
    def predict(self,X_test,algorithm):
        self.y_pre = []
        if algorithm == "E":    #Euclidean
            for x in X_test:
                index = np.argsort(np.sqrt(np.sum(np.square(self.X - x),axis=1)))[:self.neighbour]
                # print(self.y[index])
                # print(self.count_max(self.y[index]))
                self.y_pre.append(self.count_max(self.y[index]))
            self.y_pre = np.array(self.y_pre)

        elif algorithm == "M":   #Manhattan
            for x in X_test:
                index = np.argsort(np.sum(np.abs(self.X - x),axis=1))[:self.neighbour]
                self.y_pre.append(self.count_max(self.y[index]))
                # self.y_pre.append(np.argmax(np.bincount(self.y[index])))
            self.y_pre = np.array(self.y_pre)

    def score(self,y_test):
        score = 0
        score = np.sum(self.y_pre == y_test)*1.0/self.y_pre.shape[0]
        return score

    def count_max(self,data):
        class_dict = dict(Counter(data))
        predict = None
        max_time = 0
        for key,value in class_dict.items():
            if value > max_time:
                predict = key
                max_time = value
        return predict

'''
    part4:
        train and test
'''


print("-"*100)
def main():
    global x_train_pca,x_test_pca
    k_num = np.arange(1,9,2)

    save = False
    best_X = None
    best_Y = None
    best_Score =0
    best_test_Score = 0
    best_k = 0
    acc = []
    num_of_feature = 0
    n_splits = 10
    kfold = KFold(n_splits=n_splits,shuffle=True)

    for k in k_num:
        best_Score_k = 0
        classifer = Knn(k)
        print(f"k neighbors :{k}")
        ''' train '''
        for train_index,test_index in kfold.split(x_train_pca):
            X_train,X_test = x_train_pca[train_index],x_train_pca[test_index]
            num_of_feature = x_train_pca.shape[1]
            Y_train,Y_test = y_train[train_index],y_train[test_index]
            # print(Y_train.shape)
            classifer.train(X_train,Y_train)
            classifer.predict(X_test,'E')
            score = classifer.score(Y_test)
            if score > best_Score_k:
                best_Score_k = score

            if score > best_Score:
                best_X = classifer.X
                best_Y = classifer.y
                best_k = k
            # print(f"score: {score} best_Score_k: {best_Score_k}")

        ''' test '''
        classifer.train(best_X,best_Y)
        classifer.predict(x_test_pca,'E')
        score = classifer.score(y_test)
        acc.append(score)
        if(score>best_test_Score):
            best_test_Score = score
        print(f"the score of prediction on test dataset : {score:5f}")

    ''' save '''
    if(save):
        with open("./best_data.txt",'w') as f:
            f.write("#the best X:\n")
            f.write(str(best_X.tolist()))
            f.write("\n")
            f.write("#the best y:\n")
            f.write(str(best_Y.tolist()))
            f.write("\n")
            f.write("#the best score:\n")
            f.write(str(best_Score))
            f.write("\n")
            f.write("the k :\n")
            f.write(str(best_k))
    # plt.subplot(122)
    plt.plot(k_num,acc)
    plt.scatter(k_num,acc,marker='o')
    for k,a in zip(k_num,acc):
        plt.text(k,a,(k,round(a,4)))
    plt.text(4,0.4,(f"nums of features:{num_of_feature}"))
    plt.xlabel('k')
    plt.ylabel('acc')
    plt.ylim(0,1)
    plt.show()
    return best_test_Score
main()


def test_best_pca():
    p_list = []
    acc = []
    ratio = []
    for p in range(40,4):
        ratio.append(pca_down_dimension(p))
        p_list.append(p)
        acc.append(main())

    plt.scatter(p_list,acc)
    plt.ylabel('acc')
    plt.ylim(0.5,1)
    plt.xlabel('p')
    for p,a in zip(p_list,acc):
        plt.text(p,a,(p,round(a,4)))
    plt.show()

    plt.scatter(p_list,ratio)
    plt.ylabel('ratio')
    plt.ylim(0.97,1)
    plt.xlabel('p')
    for p,a in zip(p_list,ratio):
        plt.text(p,a,(p,round(a,4)))
    plt.show()


